import React, { Component } from 'react';

class Home extends Component {
	constructor(props) {
    	super(props);
    	this.state = {
    		value: null,
    	};
    }

  	render() {
    	return (
    	<div className="Home">
    	<button
        className="square"
        onClick={() => this.setState({value: 'X'})}>
        {this.state.value}
      </button>
        Home
        <p>Welcome to your fridge (user)</p>
    	</div>
    );
  }
}

export default Home;
